import React from 'react';
import { useState, useEffect } from 'react';

function Collection() {
  const [warehouse, setWarehouse] = useState([]);


  useEffect(() => {
    import('../db/db.json')
      .then(data => {
        setWarehouse(data);
      })
      .catch(error => {
        console.error('Error fetching local JSON data:', error);
      });
  }, []);

  console.log(warehouse);

  return (
    <div>
      
    </div>
  )
}


export default Collection
